import { Link } from 'react-router-dom'
import { connect } from 'react-redux'

const BasketCart = () => {
  return (
    <div>
      <h2>Faturam</h2>
    </div>
  )
}

const mapStateToProps = (state) => {
  return {
    basket: state.basket,
  }
}

export default connect(mapStateToProps)(BasketCart)
